import React from 'react'
import './style.css'
import logo from '../image/MARCA_CASA&CIA-07.png';
import Menu from './menus/Menu.js';
import ButtonsPrincipais from './buttonsPrincipais/ButtonsPrincipais.js';
import Footer from './footer/Footer.js';
import Expositores from './expositores/Expositores.js';
import Parceiros from './parceiros/Parceiros.js';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const index = () => {
  return (
    <Router>
      <img className='logo' src={logo} alt="logo" />
      <Menu />
      <ButtonsPrincipais />
      <Footer />
      <Routes>

        <Route path="/exp" element={<Expositores />} />
        <Route path="/part" element={<Parceiros />} />
      </Routes>
    </Router>
  )
}

export default index;
